eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = ([\n    {\n        \"content\": '## Intros\\n\\n<!-- ## Contents -->\\n\\n\\n## Architecture\\n\\n\\n## Frontend\\n\\n### Routing\\n- Client side routing\\n- Server side routing\\n\\n#### how next.js handles routing\\n- No explicit routing configuration needed\\n- Directory structure = URL structure\\n- page.tsx creates routes\\n- layout.tsx wraps routes\\n- Nested folders create nested routes\\n- Special file names have special meanings\\n- Everything is automatically code-split\\n\\n// These names are fixed Next.js conventions:\\npage.tsx      // ✅ Required for routes\\nlayout.tsx    // ✅ Required for layouts\\nloading.tsx   // ✅ Required for loading UI\\nerror.tsx     // ✅ Required for error boundaries\\nnot-found.tsx // ✅ Required for 404 pages\\n\\n### Styles\\n- Tailwind CSS over native CSS\\n    - describe styles declaratively using class names\\n        ```\\n        <div className=\"bg-blue-500 text-white p-4 rounded-lg\">\\n        Hello, Tailwind!\\n        </div>\\n        ```\\n    - configure theme with tailwind.config.js\\n    - built-in dark mode support\\n\\n\\n\\n## Backend\\n\\n## Deployment\\n\\n### Environment Structure\\n```\\n# Branch Structure\\nmain (production)\\n  └── staging\\n       └── development\\n            └── feature branches\\n\\n# Deployment Flow\\nfeature/* -> development -> staging -> main\\n```',\n        \"title\": \"Why this than that?\",\n        \"date\": \"2025-04-09\",\n        \"tags\": [\n            \"web dev\",\n            \"trade-offs\",\n            \"system design\"\n        ],\n        \"description\": \" A mindset go-through when developing a website.\",\n        \"featured\": false,\n        \"_meta\": {\n            \"filePath\": \"design-choices-of-web-dev.md\",\n            \"fileName\": \"design-choices-of-web-dev.md\",\n            \"directory\": \".\",\n            \"extension\": \"md\",\n            \"path\": \"design-choices-of-web-dev\"\n        },\n        \"slug\": \"design-choices-of-web-dev\"\n    },\n    {\n        \"content\": \"Orion发布后有一些感触，简单谈谈对于Meta产品设计理念的看法，Vision Pro产品定位的一些问题和我对于AR眼镜产品形态的理解。\\n\\n![Glasses, neural wristband and compute puck. Image from The Verge](images/posts/Orion-on-face.png)\\n\\nOrion采用分体式有几个我认为的原因，一个Meta的芯片设计功力没Apple强，能耗比做不上去，像Vision Pro那样的高ppi双屏显示算力不足会严重影响刷新率。Meta在这方面的自我定位一直很好，年前的Meta Rayban就是很好的例子：他们只保留了摄像头和语音模组，去掉了所有的显示，使之成为了一个很好的第一人称视角眼镜。Meta知道在功能间取舍，我的目标就是做好当前算力范围下的最优体验，不是硬堆算力和散热去让整个产品臃肿化。这种思想也根植在iPhone对于直屏的坚持中，你不得不承认\\n\\n「有时候优秀的简单设计比稀碎的复杂设计更好」。\\n\\n![Vision Pro, image by Apple](images/posts/Vision-Pro.png)\\n\\n![Meta-Rayban, image by The Verge](images/posts/Ray-Ban.png)\\n\\n而分体式可以让显示设备，即眼镜本体只专注于成像和通信，计算负荷、发热、功耗都会小很多，技术的可行性更强。这不是主要的，Apple早年在Vision Pro开发的时候也考虑过这个问题，Rockwell他们也做了一个分体式的原型，但是Ive当时给出的解释是希望可以摆脱计算中枢的束缚，能够在空间中自由移动。这个观点不无道理，但是其实像AirPods其实已经给了我们答案：\\n\\n我们只要把计算中枢小型化到能放进口袋就行了。\\n\\n放进口袋的分体式设备就是最佳的AR眼睛形态，你既不丧失设备的灵活性，又能够降低头部负荷，一举两得。\\n\\n然而新的问题诞生了，口袋计算设备一散热package不够大，第二不好做主动散热，这对计算单元的能耗比提出了更高的要求，但是终归来讲相比于Vision Pro目前的集成式迭代路线，显然更具备技术可行性。\\n\\n（计算单元的电池问题倒是很简单，采用背靠背的磁吸或触点充电形态，不够了换一块就行了，真正的难点还在overall package和ventilation）\\n\\nMeta在这次的Orion中能真正让人看到他们对于产品定位的理解：\\n\\n「我不需要那么高清的显示，相反在以现实透视画面为主的增强信息流上用摄像头辅助AI识别分析给出结果/建议，这才是人们想要的」\\n\\n人们不需要一个可以带着走的电影院，人们出门真的带把伞就足够了。\",\n        \"title\": \"Early Thoughts of Orion\",\n        \"date\": \"2024-09-28\",\n        \"tags\": [\n            \"AR\",\n            \"Hardware\",\n            \"Product Design\",\n            \"Thoughts\"\n        ],\n        \"description\": \"Why Orion should look like this, and why I think it’s a correct way of thinking.\",\n        \"featured\": false,\n        \"_meta\": {\n            \"filePath\": \"early-thoughts-of-orion.md\",\n            \"fileName\": \"early-thoughts-of-orion.md\",\n            \"directory\": \".\",\n            \"extension\": \"md\",\n            \"path\": \"early-thoughts-of-orion\"\n        },\n        \"slug\": \"early-thoughts-of-orion\"\n    },\n    {\n        \"content\": \"# Hello World\\n\\nWelcome to my first blog post! This is a sample post to demonstrate the blog functionality.\\n\\n## Code Example\\n\\nHere's a simple React component:\\n\\n```tsx\\nimport { useState } from 'react';\\n\\nexport default function Counter() {\\n  const [count, setCount] = useState(0);\\n\\n  return (\\n    <div>\\n      <p>Count: {count}</p>\\n      <button onClick={() => setCount(count + 1)}>\\n        Increment\\n      </button>\\n    </div>\\n  );\\n}\\n```\\n\\n## Features\\n\\n- Markdown support\\n- Code syntax highlighting\\n- Front matter parsing\\n- Responsive design\\n- Dark mode support\",\n        \"title\": \"Hello World\",\n        \"date\": \"2024-03-21\",\n        \"tags\": [\n            \"Next.js\",\n            \"TypeScript\",\n            \"Web Development\"\n        ],\n        \"featured\": false,\n        \"_meta\": {\n            \"filePath\": \"hello-world.md\",\n            \"fileName\": \"hello-world.md\",\n            \"directory\": \".\",\n            \"extension\": \"md\",\n            \"path\": \"hello-world\"\n        },\n        \"slug\": \"hello-world\"\n    },\n    {\n        \"content\": \"### A Brief Intro\\n\\nI have been longing for this blog for quite some time. It is not until the emergence of AI tools and some undertaken software development experience that makes this possible.\\n\\nSometimes you will have this feeling that some ideas have to get out, whether it's in the shower or some small talks with friends, and it is quite a pity that without recording, they're very easy to flee away. \\n\\nIn the days to come, I will keep updating this blog with my best ability, to capture these ideas. Hopefully, my readers, you can find this journey worthwhile.\\n\\nYou're always welcome to drop me an [email](mailto:wang.jiankai@outlook.com).\\n\\n\\n### About the Main Page Images\\nThe moss picture was taken on my last journey to Saihoji Garden in August 2024. It was a secret trip meant to get away from the normal life. All efforts paid off when reaching the temple. The tranquility and zen are beyond words.\\n\\nYou see the nature, you see the nurturance, you see momentum.\\n\\nYou discover deeper in yourself.\\n\\n![](images/saihoji-monk.jpg)\\n![saihoji moss garden, photographed in Aug,2024](images/saihoji-garden.jpg)\",\n        \"title\": \"Intros\",\n        \"date\": \"2025-03-29\",\n        \"tags\": [\n            \"introduction\",\n            \"blog\",\n            \"moss\"\n        ],\n        \"description\": \"An introduction to my blog\",\n        \"featured\": false,\n        \"_meta\": {\n            \"filePath\": \"intro.md\",\n            \"fileName\": \"intro.md\",\n            \"directory\": \".\",\n            \"extension\": \"md\",\n            \"path\": \"intro\"\n        },\n        \"slug\": \"intro\"\n    }\n]);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./.content-collections/generated/allBlogs.js\n");

